/**
 * All images used in game context
 * * Please note: All images within PIXI.js have to be .PNG
 */
const imageConfig = {
    viruses: [
        `${process.env.PUBLIC_URL}/images/virus_monster_4.png`,
        `${process.env.PUBLIC_URL}/images/virus_monster_5.png`,
        `${process.env.PUBLIC_URL}/images/virus_monster_1.png`,
    ],
    player: `${process.env.PUBLIC_URL}/images/virus_2.png`,
};

export default imageConfig;
